import Navbar from "./Navbar/Navbar";

function Landing(props){
    return (
    <div>
        <div className="container">
            <Navbar />
            <div>
                {props.children}
            </div>
        </div>
    <style jsx>{`
        .container{
            position:absolute;
            top:0px;
            left:0px;
            margin:0px;
        }
    `}</style>
    </div>
    )
}

export default Landing;
